/Science/Linear-transformation.content:
[[Transformation]] ie fonction.
Takes ***vector*** input and outputs ***vector***
We use tranformation instead of function because there is an idea of **movement** underlying.

Suppose $$
\vec{i} = \begin{pmatrix}
1 \\ 0 \\
\end{pmatrix} \text{ and }
\vec{j} = \begin{pmatrix}
0 \\ 1 \\
\end{pmatrix}$$

A linear transformation bends the space, to describe this bend it is enough to look only at
$\vec{i} \text{ and }\vec{j}$.

Geometricly : 
- During a linear tranformation the origin remains the same
- Lines remain paralel and evenly spaced
Now suppose :
$$\vec{w}=\begin{pmatrix}
x_{1} \\ x_{2}\end{pmatrix}\text{ in particular }
\vec{w}=\begin{pmatrix}
1  \\ 2\end{pmatrix}
$$
If a vector $\vec{w}$ is on the [[span]] with the bases $\vec{i}$ and $\vec{j}$, then $\vec{w} = x_{1}.\vec{i} +x_{2}.\vec{j}$ 
with $x_{1}=1$ and $x_{2} =2$ .
If we then apply  a **tranformation** on the plan or span.
We can describe the tranformation on $\vec{w}$ by looking only at the tranformation on $\vec{i}$ and $\vec{j}$.
![[Linear transformations 2022-11-03 16.25.13.excalidraw]]
here with $\vec{w'} = A\vec{w}$ and $A$ the linear transformation 
We get **$\vec{w´} = x_{1} .\vec{i´}+x_{2}.\vec{j´}$** (notice thqt $x_{1}$ and $x_{2}$ are unchanged.
So to describe the **linear transformation** of any vector we only need $\vec{i'}$ and $\vec{j'}$ !
We put them into a 2X2 Matrix $
\begin{pmatrix}
\vec{i'} & \vec{j'}
\end{pmatrix}
$ describing the transformation.
## Why the multiplication ?
$$\text{With }
\vec{i'}=\begin{pmatrix}
a \\
c \\
\end{pmatrix} \text{ and }
\vec{j'} = \begin{pmatrix}
b \\
d
\end{pmatrix} \text{ We have }
\begin{pmatrix}
a & b \\
c & d
\end{pmatrix}
\begin{pmatrix}
x_{1} \\
x_{2}
\end{pmatrix}
=x_{1}\begin{pmatrix}
a \\
c
\end{pmatrix}
+x_{2}\begin{pmatrix}
b \\
d
\end{pmatrix} = \begin{pmatrix}
ax_{1} + bx_{2} \\
cx_{1}+dx_{2}
\end{pmatrix}
$$


